sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {any} params.event
 * @param {any} params.imports
 * @param {ApiHelpers} params.helpers
 */
function handler({api, event, helpers, imports}) {
    if (api.data &&
        api.data.field_list.output &&
        (api.data.field_list.output.htmlValues || []).length > 0
    )
        api.emit('LINK_INTERCEPTOR#SAVE_URLS', api.data.field_list.output.htmlValues);
}
